import React, { useState, ChangeEvent, FormEvent } from 'react';
import {
  Container,
  Typography,
  Grid,
  TextField,
  Button,
  Box,
  Paper,
  Divider,
  Snackbar,
  Alert,
  MenuItem,
} from '@mui/material';
import { styled } from '@mui/material/styles';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';
import LocationOnIcon from '@mui/icons-material/LocationOn';

interface FormData {
  name: string;
  email: string;
  date: string;
  people: string;
  tour: string;
  message: string;
}

const StyledPaper = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4),
  marginBottom: theme.spacing(4),
}));

const ContactInfo = styled(Box)(({ theme }) => ({
  display: 'flex',
  alignItems: 'center',
  marginBottom: theme.spacing(2),
}));

const Book: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    name: '',
    email: '',
    date: '',
    people: '',
    tour: '',
    message: '',
  });
  const [openSnackbar, setOpenSnackbar] = useState<boolean>(false);

  const handleChange = (e: ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e: FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    // Here you would typically send the form data to your backend
    console.log('Form submitted:', formData);
    setOpenSnackbar(true);
    setFormData({
      name: '',
      email: '',
      date: '',
      people: '',
      tour: '',
      message: '',
    });
  };

  const handleCloseSnackbar = () => {
    setOpenSnackbar(false);
  };

  return (
    <Container sx={{ py: 8 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Book a Tour
      </Typography>

      <Grid container spacing={4}>
        <Grid item xs={12} md={6}>
          <StyledPaper elevation={3}>
            <Typography variant="h6" gutterBottom>
              Contact Form
            </Typography>
            <form onSubmit={handleSubmit}>
              <Grid container spacing={2}>
                <Grid item xs={12}>
                  <TextField
                    required
                    fullWidth
                    label="Name"
                    name="name"
                    value={formData.name}
                    onChange={handleChange}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    required
                    fullWidth
                    label="Email"
                    name="email"
                    type="email"
                    value={formData.email}
                    onChange={handleChange}
                  />
                </Grid>
                <Grid item xs={12} sm={6}>
                  <TextField
                    required
                    fullWidth
                    label="Preferred Date"
                    name="date"
                    type="date"
                    value={formData.date}
                    onChange={handleChange}
                    InputLabelProps={{
                      shrink: true,
                    }}
                  />
                </Grid>
                <Grid item xs={12} sm={6}>
                  <TextField
                    required
                    fullWidth
                    label="Number of People"
                    name="people"
                    type="number"
                    value={formData.people}
                    onChange={handleChange}
                  />
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    select
                    required
                    fullWidth
                    label="Tour Selection"
                    name="tour"
                    value={formData.tour}
                    onChange={handleChange}
                  >
                    <MenuItem value="Historic Valletta Walk">Historic Valletta Walk</MenuItem>
                    <MenuItem value="Secrets of Mdina">Secrets of Mdina</MenuItem>
                    <MenuItem value="Three Cities Tour">Three Cities Tour</MenuItem>
                  </TextField>
                </Grid>
                <Grid item xs={12}>
                  <TextField
                    required
                    fullWidth
                    label="Message"
                    name="message"
                    multiline
                    rows={4}
                    value={formData.message}
                    onChange={handleChange}
                  />
                </Grid>
                <Grid item xs={12}>
                  <Button
                    type="submit"
                    variant="contained"
                    color="primary"
                    size="large"
                  >
                    Send Booking Request
                  </Button>
                </Grid>
              </Grid>
            </form>
          </StyledPaper>
        </Grid>

        <Grid item xs={12} md={6}>
          <StyledPaper elevation={3}>
            <Typography variant="h6" gutterBottom>
              Contact Information
            </Typography>
            <ContactInfo>
              <PhoneIcon sx={{ mr: 2, color: 'primary.main' }} />
              <Typography>
                +356 9933 2288
              </Typography>
            </ContactInfo>
            <ContactInfo>
              <EmailIcon sx={{ mr: 2, color: 'primary.main' }} />
              <Typography>
                Stanmalta@hotmail.co.uk
              </Typography>
            </ContactInfo>
            <ContactInfo>
              <LocationOnIcon sx={{ mr: 2, color: 'primary.main' }} />
              <Typography>
                Malta
              </Typography>
            </ContactInfo>

            <Divider sx={{ my: 3 }} />

            <Typography variant="body2" color="text.secondary">
              Please allow up to 24 hours for a response to your booking request. For urgent inquiries, feel free to call directly.
            </Typography>
          </StyledPaper>
        </Grid>
      </Grid>

      <Snackbar
        open={openSnackbar}
        autoHideDuration={6000}
        onClose={handleCloseSnackbar}
      >
        <Alert
          onClose={handleCloseSnackbar}
          severity="success"
          sx={{ width: '100%' }}
        >
          Your booking request has been sent successfully!
        </Alert>
      </Snackbar>
    </Container>
  );
};

export default Book;
